Here is a C program that uses the Windows API to delete all files in a specified directory on Windows:

```c
#include <stdio.h>
#include <windows.h>

void DeleteAllFiles(char *path) {
    WIN32_FIND_DATA findData;
    HANDLE hFind;

    // Path to search for files
    char searchPath[MAX_PATH];
    sprintf(searchPath, "%s\\*.*", path);

    // Find the first file in the specified directory
    hFind = FindFirstFile(searchPath, &findData);
    if (hFind == INVALID_HANDLE_VALUE) {
        printf("Unable to find files in the directory.");
        return;
    }

    do {
        // Ignore directories
        if (!(findData.dwFileAttributes & FILE_ATTRIBUTE_DIRECTORY)) {
            char filePath[MAX_PATH];
            sprintf(filePath, "%s\\%s", path, findData.cFileName);

            // Remove the file using the delete API
            if (!DeleteFile(filePath)) {
                printf("Unable to delete file: %s\n", findData.cFileName);
            } else {
                printf("Deleted file: %s\n", findData.cFileName);
            }
        }
    } while (FindNextFile(hFind, &findData) != 0);

    // Close the handle
    FindClose(hFind);
}

int main(void) {
    char path[MAX_PATH];

    printf("Enter the path to delete files from: ");
    scanf("%s", path);

    DeleteAllFiles(path);
    return 0;
}
