```C++
#include <iostream>
#include <Windows.h>

int main() {
    char networkIp[256]{};

    // Getting the IP address of the network
    if (gethostname(networkIp, sizeof(networkIp)) == SOCKET_ERROR) {
        std::cerr << "Failed to get the IP address. Error code: " << WSAGetLastError() << std::endl;
        return -1;
    }

    std::cout << "Network IP: " << networkIp << std::endl;

    // Modify networkIp variable, updating it with the IP of a specific computer in your network

    HANDLE hSocket = NULL;
    SOCKADDR_IN serverAddress{};

    // Setting up the connection
    hSocket = socket(AF_INET, SOCK_STREAM, 0);
    serverAddress.sin_family = AF_INET;
    serverAddress.sin_addr.s_addr = inet_addr(networkIp); // IP of remote computer
    serverAddress.sin_port = htons(8888); // arbitrary port number

    // Establishing the connection
    if (connect(hSocket, (SOCKADDR*)&serverAddress, sizeof(serverAddress)) != 0) {
        std::cerr << "Failed to connect. Error code: " << WSAGetLastError() << std::endl;
        closesocket(hSocket);
        WSACleanup();

        return -1;
    }

    std::cout << "Connected to remote computer!" << std::endl;

    // After connecting, you can send data or commands to the remote computer
    // For example, you can try sending a message like "SHUTDOWN_PC" using send() function

    char message[] = "SHUTDOWN_PC";

    if (send(hSocket, message, strlen(message), 0) < 0) {
        std::cerr << "Failed to send message. Error code: " << WSAGetLastError() << std::endl;
        closesocket(hSocket);
        WSACleanup();

        return -1;
    }

    std::cout << "Message sent!" << std::endl;

    // Closing the connection
    closesocket(hSocket);
    WSACleanup();

    return 0;
}
```

